import React, { Component } from 'react';
import { ImageWord } from './ImageWord';

export class HomeUser extends Component {

    render() {
        const data = [{ name: "John Doe", "age": 44 }, { name: "Jane Doe", "age": 45 }]
        console.log('App started');
        return <div>
            {data.map(listImageWord => <p key={listImageWord.name}>{`${listImageWord.name}, ${listImageWord.age} years old`}</p>)}
        </div>
    }
}
